Use the %scanner Name {...} construct after the global Declaration section and before the %% sign to introduce arbitrary scanner states. The identifier following the %scanner token defines the name of the state which is used to refer to it from scanner state lists at terminals. %scanner String { %auto_newline_off %auto_ws_off
} %scanner Pragma { %block_comment "\{" "\}"
} You can place any of the ScannerDirectives within the block that defines the scanner state. By default each scanner handles (and skips) whitespace and newlines. Use %auto_newline_off and %auto_ws_off to modify each scanner state appropriately. Associate terminals with scanner states by prefixing them with a list of comma separated state names in angle brackets. Like this: StringDelimiter : <String, INITIAL>"\u{22}" ; Scanner state references in different occurrences of the same terminal are accumulated. I.e., <State1>"term"
...
<State2>"term" will result in <State1, State2>"term" Terminals without explicitly associated scanner state are implicitly associated with scanner state INITIAL. Scanner state switching is initiated within your productions like in the following two examples: String: StringDelimiter %sc(String) StringContent StringDelimiter %sc(); or String: StringDelimiter %push(String) StringContent StringDelimiter %pop(); The %sc instruction is used to switch directly to the state named in the parentheses. The INITIAL state can be omitted as seen in the second occurrence of the first example, i.e. %sc() and %sc(INITIAL) are equivalent. The %push instruction is used to push the index of the current scanner on the internal scanner stack and to switch to a scanner configuration with the given index in parentheses. The %pop instruction is used to pop the index of the scanner pushed before and to switch to the scanner configuration with that index. Currently the scanner state switching only works if the lookahead at the point where the switch is made is only of size 1 because the lookahead mechanism is not aware of scanner states. This means the provision of lookahead tokens will be made with the current active scanner and may fail if a token is not known by it. In most cases this can be circumvented by an appropriate grammar formulation. If the scanner switch was successful the lookahead buffer is invalidated. You may have look at example scanner_states that demonstrates the handling of scanner states.

