Having such a transformed grammar all productions have the form \[v: s*; \] where \(v \epsilon V, s \epsilon (V \cup \Sigma)\), \(V\) is the set of non-terminals, \(\Sigma\) is the set of terminals. The relation of the generated productions to their original EBNF constructs is actually lost at this point. But because we need the information if a set of productions was originated from, e.g. an optional construct ([...]) parolconveys these relationship during the whole transformation process to be able to infer it into a Rust Option<T> eventually. To explain it using the form of transformation shown above we could write this: A: [B]; => A: BOpt; BOpt: B; BOpt: ; => typeof A = Option<typeof B> This step leads directly to a solution if non-terminal A has only one production. In this case the the type of A is struct A { b: Option<B>
} We must use a struct here because this patterns should work for productions with \(n\) elements on its right-hand side. For each such element we then introduce a separate member into the struct. If non-terminal A has more than one productions the resulting type of A will be a Rust enum type with \(n\) enum variants for \(n\) productions, e.g.: A: B | C; => A: B; A: C; => struct B { // ...
}
struct C { // ...
}
// Type of non-terminal A
enum A { A0(B), A1(C),
} When finally all types for all non-terminals are inferred parol generates an overall AST type. This is also a Rust enum. It comprises all non-terminal types of the grammar and provides exactly one enum variant for each of them. This type is mainly used by the parser itself to be able to instantiate a typed parse stack. The user rarely have to deal with this AST enum.

