You can specify a user type to be inserted into the AST structure at the place where the symbol would otherwise had the originally generated type. Add after a grammar symbol a colon followed by a user type name to instruct parol to use this type instead. In your language implementation you have to provide fallible or infallible conversions from the original generated types to your types by implementing one of the traits From or TryFrom. An examples can be found in the list_auto example. You can also define aliases for the user type names by inserting as many %user_type directives as you want. Then use these aliases behind the colons. You may have look at example list_auto that demonstrates the handling of user types. %start List
%title "A possibly empty comma separated list of integers"
%comment "A trailing comma is allowed."
%user_type Number = crate::list_grammar::Number
%user_type Numbers = crate::list_grammar::Numbers %% List: [Items: Numbers] TrailingComma^;
Items: Num {","^ Num};
Num: "0|[1-9][0-9]*": Number;
TrailingComma: [","^]; In this example grammar the terminal in the production Num is assigned to the user type Number which in turn is a shorthand for crate::list_grammar::Number. Also the non-terminal Items is assigned to the user type Numbers which in turn is a shorthand for crate::list_grammar::Numbers. The parser generator substitutes the automatically inferred type in the type of the production by the user provided one and the parser calls the conversion form the original type to the user type at parse time. The original type is the one of the source item in the grammar - terminal or non-terminal. Please have a look at the generated semantic action of the internal wrapper for production 1 of the expanded grammar list-exp.par which can be found in also generated traits file examples\list_auto\list_grammar_trait.rs: /// Semantic action for production 1: /// /// ListOpt /* Option<T>::Some */: Items : Numbers; /// #[named] fn list_opt_0( &mut self, _items: &ParseTreeStackEntry<'t>, _parse_tree: &Tree<ParseTreeType<'t>>, ) -> Result<()> { let context = function_name!(); trace!("{}", self.trace_item_stack(context)); let items = if let Some(ASTType::Items(items)) = self.pop(context) { items } else { bail!("{}: Expecting ASTType::Items", context); }; let list_opt_0_built = ListOptBuilder::default() .items((&items).try_into().into_diagnostic()?) .build() .into_diagnostic()?; self.push(ASTType::ListOpt(Some(Box::new(list_opt_0_built))), context); Ok(()) } At the line after the trace the original item is popped from the parse stack. It has the Rust type Items: /// Type derived for non-terminal Items
pub struct Items { pub num: Box<Num>, pub items_list: Vec<ItemsList>,
} Then later at the construction of the ListOpt structure with the help of the ListOptBuilder the conversion to the user's type is called: .items((&items).try_into().into_diagnostic()?). The TryFrom trait is provided by the user. Please see examples\list_auto\list_grammar.rs for that: impl TryFrom<&Items> for Numbers { type Error = <u32 as FromStr>::Err; fn try_from(items: &Items) -> Result<Self, Self::Error> { Ok(Self(items.items_list.iter().fold( vec![items.num.num.0], |mut acc, e| { acc.push(e.num.num.0); acc }, ))) }
} This is an example how non-terminal types are converted into user types. The easier variant is the conversion of a terminal type (i.e. a Token) into a user type. You can find an example also in examples\list_auto\list_grammar.rs: impl<'t> TryFrom<&Token<'t>> for Number { type Error = <u32 as FromStr>::Err; fn try_from(number: &Token<'t>) -> Result<Self, Self::Error> { Ok(Self(number.text().parse::<u32>()?)) }
} Here the scanned text of the token is accessed using the property symbol of the Token type that was imported from the parol_runtimecrate. This text is then parsed into a u32 type and finally wrapped into a Numbertype which is a newtype for u32. By implementing some From or TryFrom traits for your user type you can integrate them easily into the parse process. There exist some examples that can help to become familiar with this concept. Maybe you would like to have a look at my rudimentary basic interpreter example .

