Although the auto-generation mode (switch -g, --auto_generate) is the recommended way to use parol you can alternatively work in vanilla mode . That means that parol skips generating AST types for you and it generates only a trait with semantic actions for each production of the expanded grammar instead of semantic actions for each non-terminal. This means that you gain more control although you may loose some comfort. Basically it is a matter of taste what mode you use. But keep in mind that growing complexity can have an impact on the maintainability of your software. So although you may loose full speed and give up some control you obtain maintainability when using the auto-generation mode. Actually parol itself was build in the simple mode at the first stages of its development (before version 0.9.3). But the implementation of new features required more and more changes in the grammar and showed the vulnerability of the existing implementation to changes in the input grammar. Anyway, this chapter is dedicated to the way parol functions without auto-generation. You may have a look at example list that uses the vanilla mode and actually shows how easy it is to work this way. We will elaborate this by implementing a list example in an alternative way. %start List
%title "A possibly empty comma separated list of integers"
%comment "A trailing comma is allowed." %% List: Items TrailingComma^;
Items: Num {","^ Num} | ;
Num: "0|[1-9][0-9]*";
TrailingComma: [","^]; Let's generate a new binary crate: You can try this grammar by calling parol new --bin --path ./vanilla_list --tree Open the generated crate and substitute the generated dummy grammar by the one above. Open the build.rs and delete the line 11: .enable_auto_generation() For the sake of completeness delete the -g from the CLI equivalent in the comment at the beginning of main. Also change the test.txt to the content 1, 2, 3, 4, 5, 6, Now you can parse this text by calling cargo run ./test.txt This will actually result in a bunch of errors because parol new generated the source for the new crate in the spirit of auto-generation mode. But fortunately it is easy to correct the errors and create the basis for our vanilla mode crate. Replace the content of vanilla_list_grammar.rs with the following lines use id_tree::Tree;
