use parol_runtime::parser::{ParseTreeStackEntry, ParseTreeType};
use std::fmt::{Debug, Display, Error, Formatter}; use crate::vanilla_list_grammar_trait::VanillaListGrammarTrait; ///
/// The value range for the supported list elements
///
pub type DefinitionRange = usize; ///
/// Data structure that implements the semantic actions for our list grammar
///
#[derive(Debug, Default)]
pub struct VanillaListGrammar { pub numbers: Vec<DefinitionRange>,
} impl VanillaListGrammar { pub fn new() -> Self { VanillaListGrammar::default() } fn push(&mut self, item: DefinitionRange) { self.numbers.push(item) }
} impl Display for VanillaListGrammar { fn fmt(&self, f: &mut Formatter<'_>) -> std::result::Result<(), Error> { writeln!( f, "[{}]", self.numbers .iter() .map(|e| format!("{}", e)) .collect::<Vec<String>>() .join(", ") ) }
} impl VanillaListGrammarTrait for VanillaListGrammar {} Now you should be able to run the parser $ cargo run ./test.txt
